import React, { Component } from 'react';



class Toprankingcomp extends Component{

    render(){
        return(
            <div>
            <table>
                <tr>
                    <tb class="count">biswanath</tb>
                    <tb class="user-img"> <img alt="not found"/></tb>
                    <tb class="wpm">wpm</tb>
                    <tb class="ago">ago</tb>
                </tr>
            </table>
            </div>
        );
    }
}


export default Toprankingcomp;
